Let's solve the system of equations:

\begin{align*}
-2c - 10 &= 4k, \\
-3c + 17 &= -k - 3.
\end{align*}Adding the two equations, we get $(-2c - 10) + (-3c + 17) = 4k + (-k - 3)$, which simplifies to $-5c + 7 = 3k - 3$. Solving for $k$, we get $k = -c + 2$.

We want to find the nearest to $k$ in $2/23$, $-5$, and $-1/2$. Since $-c + 2$ is the same as $2 - c$, the numbers nearest to $-c + 2$ are $2 - c$ and $-c$, which are equal to $2/23$, $-5$, and $-1/2$ in order. Therefore, the answer is $\boxed{-1/2}$. The answer is -\frac{1}{2}

